;; **
;;; In this tutorial, we illustrate by example why sequential Monte Carlo (SMC) fails to perform well on certain categories of inference problem, suffering from an issue known as **sample degeneracy**. This failure directly motivated the development of more complex inference algorithms that use particle-based methods like SMC as a subroutine - the class of particle Markov chain Monte Carlo (PMCMC) algorithms.
;;; 
;;; We begin by studying SMC's performance on a standard Gaussian random walk with unit variance:
;;; 
;;; $$ z\_0 \sim N(0, 1) $$
;;; $$ z\_t | z\_{t-1} \sim N(z\_{t-1}, 1) $$
;;; $$ x\_t | z\_t \sim N(z\_t, 1) $$
;;; 
;;; This model is straightforwardly represented by the following query:
;; **

;; @@
(defquery ssm [x]
  (let [T (count x)
        z0 (sample (normal 0 1))]
    (observe (normal z0 1) (first x))
    
    (loop [t 1
           z [z0]]
      (if (= t T)
        z
        
        (let [zt (sample (normal (last z) 1))
              xt (nth x t)]
          (observe (normal zt 1) xt)
          (recur (+ t 1)
                 (conj z zt)))))))


;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;degeneracy/ssm</span>","value":"#'degeneracy/ssm"}
;; <=

;; **
;;; As our observations @@x\_t@@, we choose a simple ramp. Then, we run SMC with a relatively-small number of particles, and study the trajectories sampled from the posterior:
;; **

;; @@
(def x (range 0 100 2))
(def T (count x))

(def S 150)

(def particles 
  (map :result (take S
                     (doquery :smc ssm [x] :number-of-particles S))))

(def lowest (apply min (apply concat particles)))
(def highest (apply max (apply concat particles)))

(apply plot/compose
       (conj
         (map #(plot/list-plot % :joined :true :plot-range [[0 (- T 1)] [lowest highest]])
              (take 150 particles))
         (plot/list-plot x :color "blue")))
