;; <=

;; **
;;; While we haven't calculated the explicit posterior distribution, it should be relatively clear that, even for this small number of particles, SMC performs quite well on this particular inference problem.
;;; 
;;; In general, SMC will perform well on models in which the hidden state obeys the **Markov property**. We say that a model has the Markov property when the hidden state @@z\_t@@ at time @@t@@ is dependent only on the hidden state at the previous timestep, and conditionally independent of hidden states before the previous timestep. Visually, a probabilistic program obeys the Markov property if the Bayes net it defines has a structure like this one:
;; **

;; @@
(image/image-view 
  (ImageIO/read 
    (io/resource "degeneracy/rw_bayes_net.png")) 
  :type "png" 
  :alt "Random Walk Bayes Net" 
  :width 350)
