;; <=

;; **
;;; SMC performs well on such models because, at each timestep @@t@@, the posterior distribution @@p(z\_0, ..., z\_t | x\_0, ..., x\_t)@@ is only related to the posterior distribution at the previous timestep @@p(z\_0, .., z\_{t-1} | x\_0, ..., x\_{t-1})@@, the transition distribution @@p(z\_t | z\_{t-1})@@, and the observation model @@p(x\_t | z\_t)@@. This plays to the strengths of the SMC algorithm: given a set of samples from the approximation to the posterior at the previous timestep, we can simply sample a set of possible new hidden states @@z\_t \sim p(z\_t | z\_{t-1})@@, score them based on the observation distribution @@p(x\_t | z\_t)@@, and then resample.
;;; 
;;; However, there is a slight issue with this method. As the length of the SSM @@T@@ grows larger and larger, repeated resampling eventually leads to a lack of sample diversity for earlier timesteps. Plotted below is the set of distinct samples as a function of the timestep. We can clearly see that, as we move further into the past, there is an exponential decline in sample diversity:
;; **

;; @@
;; plot the # of distinct samples as a function of the timestep...

(def distincts
  (map
    (fn [n] (count (distinct (map #(nth % n) particles))))
    (range 0 T)))

(plot/list-plot distincts :joined :true)

