;; <=

;; **
;;; If you go back and run more particles (i.e. increase `S` and repeat inference), you can easily see that while we can shift this exponential decline upwards, we can't eliminate it. In general, to get the diversity at early timesteps that we have at late timesteps with @@S@@ particles, we must run exponentially more samples.
;; **

;; **
;;; In this particular case, the lack of sample diversity is not a *huge* problem, because the program in question obeys the Markov property. One can argue that the lack of sample diversity, in fact, is a reasonable representation of how subsequent observations @@x\_1, ..., x\_T@@ shrink the uncertainty about the original hidden state @@z\_0@@. As we get more and more information, our posterior estimates about the original hidden state @@z\_0@@ become increasingly certain. However, in models that don't obey the Markov property, this lack of sample diversity can be a larger problem.
;;; 
;;; Such a model is given below. We augment our random walk with an exponential decay factor as follows:
;;; 
;;; $$ z\_0 \sim N(0, 1) $$
;;; $$ a \sim N(1, 1) $$
;;; $$ z\_t | a, z\_{t-1} \sim N(a z\_{t-1}, 1) $$
;;; $$ x\_t | z\_t \sim N(z\_t, 1) $$
;;; 
;;; Here, instead of depending purely on the previous hidden state @@z\_{t-1}@@, the hidden state at time @@t@@ also depends on a multiplicative factor @@a@@. We place a Gaussian prior on the factor @@a@@ with mean one (notice that @@a=1@@ reduces to the previous random walk).
;;; 
;;; With high probability, SMC performs very poorly on this inference problem. By running the below program several times, see how the estimated trajectories are very likely to exponentially diverge from the observations:
;; **

;; @@
(def S 150)

(defquery ssm-2 [x]
  (let [T (count x)
        z0 (sample (normal 0 1))
        a (sample (normal 1 1))]
    (observe (normal z0 1) (first x))
    
    (loop [t 1
           z [z0]]
      (if (= t T)
        {:a a :z z}
        
        
        (let [zt (sample (normal (* a (last z)) 1))
              xt (nth x t)]
          (observe (normal zt 1) xt)
          (recur (+ t 1)
                 (conj z zt)))))))


(def particles 
  (map :result (take S
                     (doquery :smc ssm-2 [x] :number-of-particles S))))

(apply plot/compose
       (conj
         (map #(plot/list-plot % :joined :true)
            (map :z particles))
         (plot/list-plot x :color "blue")))

