;; **
;;; With high probability, by the time we've reached the end of the program, there is only one remaining sample for the quantity @@a@@ - in other words, we have complete sample degeneracy. And with high probability, this sample is far enough from 1 that the sampled trajectories @@p(z\_0, ..., z\_T | a)@@ diverge exponentially from the observations @@\\{x\_t\\}\_{t=0}^{T-1}@@ - which they should approximately track. So we have horrible sample degeneracy when trying to infer the factor @@a@@, and the few samples we do get seem to be terrible ones.
;;; 
;;; This happens for two reasons. Firstly, because the above model - a Gaussian random walk with an unknown parameter - has a heavily non-Markovian structure. The hidden state at time @@t@@ is not purely a function of the hidden state at the previous timestep - it also depends very heavily on the value @@a@@. Visually, this program is represented by the following Bayes net:
;; **

;; @@
(image/image-view 
  (ImageIO/read 
    (io/resource "degeneracy/rw_param_bayes_net.png")) 
  :type "png" 
  :alt "Random Walk with Parameter - Bayes Net" 
  :width 450)
;; @@
