;; <=

;; **
;;; Secondly, and more importantly, this non-Markovian model is actually a particularly unfortunate one. Sample diversity goes down exponentially with time, so we would expect that by the time our program has reached even @@t=10@@, there may be only a few distinct values of @@a@@ remaining. However, in this program, it is actually the latter observations @@x\_t@@, closer to the end, that carry more information about the factor @@a@@ - the earlier observations matter less. So by the time we reach the point where the observations matter most, we've likely already succumbed to sample degeneracy.
;;; 
;;; For instance, at time @@t=1@@, almost any choice of the factor @@a@@ is permissible - if @@z\_0 = 1@@, for instance, even choosing the extreme value @@a=2@@ yields the expectation @@E[z\_1 | z\_0, a] = az\_0 = 2@@, which appears to be a good explanation of the data. But at step @@t=41@@, things are different. If for instance @@z\_{40} = 80@@, which is likely, then @@E[z\_{41} | z\_{40}, a] = az\_{40} = 80a@@. In order to ensure that @@z\_{41}@@ is no further than 5 away from the true observation 82, it must be the case that @@a@@ is bounded within a very small interval: @@|E[z\_{41} | z\_{40}, a] - 82| < 5 \rightarrow -5 < 80a-82 < 5 \rightarrow 0.9625 < a < 1.0875 @@. With significant probability, though, sample degeneracy might have ensured that there are no samples inside this range. If this is the case, then sequential Monte Carlo will fail to explain the supplied observations, and will fail to give quality samples from the posterior distribution. This problem gets exponentially worse as time goes on.
;;; 
;;; However, other inference algorithms may still perform well. For example, for the same number of particles (but likely at the cost of more computation time), the particle cascade is still quite likely to draw high-quality samples (though not *certain*):
;; **

;; @@
(def S 150)

(def samples 
  (empirical-distribution
    (collect-results
      (take S 
            (doquery :pcascade ssm-2 [x])))))

(def particles (map first samples))
(def probs (map second samples))

(apply plot/compose
       (conj
         (map #(plot/list-plot %1 :joined :true :opacity (Math/pow %2 0.005))
              (map :z particles)
              probs)
         (plot/list-plot x :color "blue")))


(plot/list-plot (partition 2
                           (interleave (map :a particles) probs))
                :plot-range [[0 2] [0 1]])

(count (distinct (map :a particles)))
